import React from "react";

function Interests() {
    return (
        <div class="stuff">
            <h1>Resume</h1>
            <h2>Adeola Ogundipe</h2>
            <hr />
            <br />
            <p>Interests</p>
            <ul>
                <li>Drawing</li>
                <li>Photography</li>
                <li>Design</li>
                <li>Programming</li>
                <li>WDesign</li>
                <li>Computer Science</li>
            </ul>
        </div>

    );
}

export default Interests;
